// import About from "./About";
// import Gallery from "./Gallery";
// import Contact from "./Contact";
import React from "react";
import "./style.css"
class App extends React.Component{
    render(){
        return(
            <>
            <h4>QTrip</h4>
            <div>
            <ul>
                <li>+Home</li>
                <li>Reservations</li>
                <li id="lg">Login Here</li>
                <li><button>Register</button></li>
            </ul>
            </div>
            <div id="bg"></div>
            <input type="text" placeholder="Search City"></input>
            <h1>Welcome to QTrip</h1>
            <p>Explore the world with fantastic places to venture around</p>
            <div id="im">
                <img src="https://images.pexels.com/photos/3573382/pexels-photo-3573382.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" alt="im1"/>
                <img src="https://images.pexels.com/photos/1078983/pexels-photo-1078983.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" alt="im2"/>
                <img src="https://images.pexels.chttps://i.ibb.co/WVL7n8K/singapore.jpgom/photos/2524368/pexels-photo-2524368.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt="im3"/>
                <img src="https://i.ibb.co/WVL7n8K/singapore.jpg" alt="im4"/>
                <img src="https://images.pexels.com/photos/2940925/pexels-photo-2940925.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt="im5"/>
                <img src="https://images.pexels.com/photos/1682748/pexels-photo-1682748.jpeg?cs=srgb&dl=pexels-ingo-joseph-1682748.jpg&fm=jpg" alt="im6"/>
                <img src="https://images.pexels.com/photos/2422588/pexels-photo-2422588.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" alt="im7"/>
                <img src="https://images.pexels.com/photos/1461974/pexels-photo-1461974.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt="im8"/>

            </div>
            <div id="ben"> 
            <h1 style={{position:"absolute",color:"white",}}>Bengalore</h1>
            <h3>100+ places</h3>
            </div>
            </>
        )
    }
}
export default App
